import React from "react";
import makeStyles from '@mui/styles/makeStyles';
import { Grid, Typography,Button, Container } from "@mui/material";
import ReactPlayer from 'react-player';
import video from '../Components/About/img/slot.mp4';


import IconButton from "@material-ui/core/IconButton";
import FastRewindIcon from "@material-ui/icons/FastRewind";
import FastForwardIcon from "@material-ui/icons/FastForward";
import PlayArrowIcon from "@material-ui/icons/PlayArrow";
import PauseIcon from "@material-ui/icons/Pause";
import Slider from "@material-ui/core/Slider";
import Tooltip from "@material-ui/core/Tooltip";
import VolumeUpIcon from "@material-ui/icons/VolumeUp";
import FullScreenIcon from "@material-ui/icons/Fullscreen";
import Popover from "@material-ui/core/Popover";

const useStyles = makeStyles((theme) => ({
  main:{
    background:'linear-gradient(360deg, #FFF 0%, #F4F5F7 30%)',
    mixBlendMode:'normal',
  },
  hakkimizda:{
    border:'1px solid blue',
    marginTop:'80px'
  },
  playerWrapper:{
    width:'100%',
    position:'relative'
  },
  controlsWrapper:{
    position:'absolute',
    top:0, left:0, bottom:0 , right:0,
    background:'rgba(0,0,0,0,6)',
    display:'flex',
    flexDirection:'column',
    justifyContent:'space-between',
    zIndex:1
  },
}));


export default function About(){
  const classes = useStyles();
  return(
    <Grid 
    className={classes.main}
    container 
    direction='column' 
    justifyContent='center' 
    alignItems='center'
    >

      <Grid container item alignItems='center' justifyContent='center' spacing={8} >

        <Grid item xs={7} >
          <Typography variant='subtitle1' className={classes.hakkimizda} color='primary'
          > Hakkimizda </Typography>
        </Grid>
        
        <Grid  item xs={7}>
          <Button>Tarihce</Button>
          <Button>Politikalar</Button>
          <Button>Neden Biz?</Button>
          <Button>Sirket Bilgileri</Button>
        </Grid>

      </Grid>
      
      <Container maxWidth='md'>
        <div className={classes.playerWrapper}>

          <ReactPlayer 
          width={'100%'}
          height={'100%'}
          url={video} 
          muted={false}
          playing={true}
          />

          <div className={classes.controlsWrapper}>
            <Grid container direction='row' alignItems='center' justify='space-between' style={{padding:16}}>

            </Grid>
          </div>

        </div>
      </Container> 
    
    
    </Grid>
  );
};
